import "./App.css";

function App() {
  const now = Date();
  const a = 10;
  const b = 20;

  console.log(now, a + b);
  return (
    <div>
      <p>Hello world, it is {now.toString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
    </div>
  );
}

export default App;
